/**
 * Arguments for the `itemClick` event of the ActionSheet.
 */
export class ActionSheetItemClickEvent {
    /**
     * The ActionSheet item that was clicked.
     */
    item;
    /**
     * The DOM event that triggered the `itemClick` event.
     */
    originalEvent;
}
